import React from "react";
import { Link } from "react-router-dom";
import "./nav.css";

const Nav = () => {
  return (
    <div className="nav">
      <div className="logo">
        <Link to="/">Galaxy</Link>
      </div>
      <div className="listname">
        <Link to="/Home">Home</Link>
        <Link to="/Contact">Contact</Link>
        <Link to="/Pricing">Pricing</Link>
      </div>
    </div>
  );
};

export default Nav;
